import React from "react";
import "./FaceRecognition.css";

const FaceRecognition = ({ imageUrl, faceFrame }) => {
  return (
    <div className="center ma">
      <div className="absolute mt2">
        <img alt="" src={imageUrl} width="580px" height="auto" />
        <div
          className="faceBox"
          style={{
            inset: `${faceFrame.top * 100}% ${faceFrame.right * 100}% ${
              faceFrame.bottom * 100
            }% ${faceFrame.left * 100}%`,
          }}
        ></div>
      </div>
    </div>
  );
};

export default FaceRecognition;
